body {
            font-family: 'Segoe UI', system-ui, sans-serif;
            background-color: #0a192f;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            margin: 0;
            color: white;
            text-align: center;
        }

        .container {
            position: relative;
            bottom: 15%;
            background-color: #1a2a4f;
            padding: 3rem;
            border-radius: 6px;
            box-shadow: 0 10px 30px rgba(0, 0, 0, 0.5);
            max-width: 600px;
            width: 90%;
        }

        h1 {
            font-size: 2.5rem;
            margin-bottom: 1.5rem;
            color: #fff;
        }

        p {
            font-size: 1.2rem;
            margin-bottom: 2rem;
            line-height: 1.6;
        }

        .learn-more-button {
            display: inline-block;
            background-color: #0d6efd;
            color: white;
            padding: 0.9rem 2rem;
            border: none;
            border-radius: 8px;
            text-decoration: none;
            font-weight: 600;
            font-size: 1.1rem;
            margin-top: 1rem;
            transition: transform 0.2s, background 0.3s;
            cursor: pointer;
        }

        .learn-more-button:hover {
            transform: translateY(-3px);
            background-color: #5b8fdb;
        }

        .learn-more-button i {
            margin-left: 8px;
        }

const learnMoreButton = document.getElementById("learn-more-button");
        learnMoreButton.addEventListener('click', function() {
            window.open("https://github.com/Cydog-Browser/deterrent-renderer", "_blank");
        });
        confetti({
            particleCount: 100,
            spread: 70,
            origin: { y: 0.6 }
        });
        setInterval(function() {
            confetti({
                particleCount: 100,
